import React from 'react'

const Dealer = () => {
    return (
        <div>
            <h2 className='text-[26px] pl-2 mb-[25px] border-l-2 border-[#d01818]'>Become Dealer</h2>
            <h4 className='text-[18px]'>Dealer Account</h4>
            <div class="rounded-[4px] text-[#664d03] bg-[#fff3cd] border border-[#ffecb5] p-4 mb-4">Your current account type is normal. If you want to become a dealer, please click on button Become a Dealer</div>
            <button>Become a Dealer</button>
        </div>
    )
}

export default Dealer
